import React from 'react';
import './App.css';
import img from './Assets/logo.png';

function MainPage(props){
    console.log("here");
    return(
        <div id="container">
            <header className="header">
                <div className="contHeaderBtn">
                    <img src={img} height="60px" />
                    <p>Servicos</p>
                    <p>Clientes</p>
                    <p>Financeiro</p>
                </div>


            </header>

            <body className="body">

            </body>

          
        </div>
    );
}

export default MainPage;
